lpadding="0"><tr><td><img width="136" height="15" src="data:image/png;base64,"/></td></tr></table></span></p><p class="s18" style="padding-top: 2pt;padding-left: 283pt;text-indent: 0pt;line-height: 126%;text-align: left;">Alhaj Tower, Fourth Floor (Level-3), 82 Motijheel C/A, Dhaka-1000.</p><p style="text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="92" height="15" src="data:image/png;base64,"/></td></tr></table></span></p><p class="s18" style="padding-left: 283pt;text-indent: 0pt;line-height: 10pt;text-align: left;">DSE TREC No. 275 &amp; CSE TREC No. 158</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s18" style="padding-left: 66pt;text-indent: 0pt;text-align: left;">’BROKER’ shall mean ANC SECURITIES LIMITED</p><p class="s18" style="padding-top: 5pt;padding-left: 66pt;text-indent: 0pt;text-align: left;">‘BUYER&#39; shall mean the person or persons or company who intends to buy securities through the BROKER.</p><p class="s18" style="padding-top: 5pt;padding-left: 66pt;text-indent: 0pt;line-height: 109%;text-align: left;">“SELLER&#39; shall mean the person or persons or company who intends to sell his/her/their securities through the BROKER”</p><p class="s18" style="padding-top: 4pt;padding-left: 66pt;text-indent: 0pt;text-align: left;">“Securities account” shall mean the account opened by the SELLER/BUYER with the BROKER to sell/buy securities.</p><p class="s18" style="padding-top: 4pt;padding-left: 66pt;text-indent: 0pt;line-height: 111%;text-align: left;">“Securities Day” shall mean the days declared by the Stock Exchange, on which transactions carried out by the BROKER on behalf of the SELLER/BUYER at the Stock Exchange are settled/cleared with Stock Exchange.</p><p class="s18" style="padding-top: 4pt;padding-left: 66pt;text-indent: 0pt;text-align: left;">‘CDBL&#39; shall mean Central Depository Bangladesh Limited was incorporated 20th August 2000 in Bangladesh.</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s18" style="padding-left: 66pt;text-indent: 0pt;line-height: 109%;text-align: left;">The SELLER shall deliver to the BROKER valid and negotiable documents. i.e, transfer/s documents duly completed and signed by the SELLER together with relative securities certificates with valid title, prior to placing a sale order. If for</p><p class="s18" style="padding-left: 66pt;text-indent: 0pt;line-height: 109%;text-align: left;">any reason whatsover secutities documents delivered by the SELLER turns out to be forged, invalid, worn out, torn ro defaced, the defaulting SELLER shall be liable to his BROKER for any loss or damage sustained or incurred. The defaulting SELLER shall be liable to replace such securities along with all benefits attributable to such securities within two days of reporting in writing ot the SELLER by the BROKER. If for any reason the defaulting SELLER fails to replace such securities along with all benefits attributable to such securites within two days for reporting in writing to the SELLER by the BROKER, The BROKER shall have the absolute discreting to square-up the transaction commencing from the market day after the stipulated period (as above), at the SELLERS risk and the SELLER shall be liable to the BroKer for any loss or damage sustained or incuarred.</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s18" style="padding-left: 66pt;text-indent: 0pt;line-height: 109%;text-align: left;">The BROKER shall make paymnet to the SELLER on the settlement day, subject to the overall cash balance of the Seller&#39;s “Securities Account”</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s18" style="padding-left: 66pt;text-indent: 0pt;line-height: 107%;text-align: justify;">The BUYER shall pay his BROKER on or before the settlement day balance amount (if any) including charges of all securities purchased by him during the period of dealing for that settlement. If the BUYER detaults for whatever reason, he shall be liable to his BROKER for all loss or damage sustained or incurred. In addition, to adjust the out standing amount, the buying BROKER shall have the absolute discretion, to resell commencing from the market day after the day to settlement, the securities at the BUYER&#39;S risk and the BUYER shall be liable to the buying BROKER for any loss or damage sustained incurred.</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s18" style="padding-left: 66pt;text-indent: 0pt;text-align: left;">If the CDBL is involved in the settlement process client should follow the under mention rules.</p><p class="s18" style="padding-top: 5pt;padding-left: 66pt;text-indent: 0pt;text-align: justify;">Client must maintain a Beneficiary Owner account with any depository participant, and client must inform the broker his BO account number with authentic document.</p><p class="s18" style="padding-top: 5pt;padding-left: 66pt;text-indent: 0pt;text-align: justify;">Before place any sell order client must transfer his shares from his BO account to broker clearing account with related instruction.</p><p class="s18" style="padding-top: 5pt;padding-left: 66pt;text-indent: 0pt;text-align: justify;">Client will pay the charges of CDBL, if necessary to transfer the shares from client BO account to broker clearing account and clearing account to BO account</p><p class="s18" style="padding-top: 5pt;padding-left: 66pt;text-indent: 0pt;line-height: 107%;text-align: justify;">Broker reserve the absolute right to deduct the charges at source where applicable related to client CDBL operation. Client will be liable for any losses or damages occurred due to wrong or incorrect information related to CDBL is given by the client.</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 44pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="153" height="28" src="data:image/jpg;base64,"/></td></tr></table></span></p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 67pt;text-indent: 0pt;line-height: 112%;text-align: justify;">All transactions shall be subject to the rules and regulations, of the Securities and Exchange Commission/ Dhaka Stock Exchange Limited, Chittagong Stock Exchange Limited, CDBL and other prevailing laws and regulations of Bangladesh and in particular the authority here in after granted by the Client to the BROKER.</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 67pt;text-indent: 0pt;line-height: 112%;text-align: justify;">The broker reserves the absolute right for sale/buy make adjustment/transter any at client&#39;s risk in order to set of all losses, damages and debit amount/shares/securities of “Client Account”</p><p style="padding-top: 4pt;padding-left: 67pt;text-indent: 0pt;text-align: left;">Clients shall be bound to pay       %(inword</p><p style="padding-top: 1pt;padding-left: 67pt;text-indent: 0pt;text-align: left;">as brokerage to broker for buy and sell and broker can change time to time.</p><p style="padding-top: 4pt;padding-left: 64pt;text-indent: 0pt;text-align: center;">)charges</p><p style="padding-top: 6pt;padding-left: 67pt;text-indent: 0pt;line-height: 113%;text-align: justify;">Client shall be bound to furnish such other particulars, documents and or information that may reasonably require from time to time. Broker shall have the right to change /modify any terms/conditions when may deem necessary without any notice to the client. We hereby accept your above terms and conditions and we declare that the information given is true and correct.</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 67pt;text-indent: 0pt;text-align: justify;">Signature of Customer :</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-top: 5pt;padding-left: 67pt;text-indent: 0pt;text-align: left;">Witness : 1. Signature</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="text-indent: 0pt;text-align: right;">Address</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 62pt;text-indent: 0pt;text-align: left;">FOR OFFICE USE ONLY :</p><p style="padding-top: 6pt;text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 62pt;text-indent: 0pt;line-height: 265%;text-align: left;">Introduced by : Signature</p><p style="padding-top: 5pt;padding-left: 89pt;text-indent: 0pt;text-align: left;">2. Signature</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 101pt;text-indent: 0pt;text-align: left;">Address</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 64pt;text-indent: -1pt;line-height: 267%;text-align: left;">Approved by : Signature</p><p style="text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="756" height="500" src="data:image/jpg;base64,"/></td></tr><tr><td><img width="756" height="500" src="data:image/jpg;base64,"/></td></tr></table></span></p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s10" style="padding-left: 63pt;text-indent: 0pt;text-align: center;">THIS AGREEMENT made this           Day of         20           of the Christian Era.</p><p style="padding-top: 6pt;text-indent: 0pt;text-align: left;"><br/></p><p class="s10" style="padding-left: 62pt;text-indent: 0pt;text-align: center;">BETWEEN</p><p class="s10" style="padding-top: 5pt;padding-left: 66pt;text-indent: 0pt;line-height: 120%;text-align: left;">ANC SECURITIES LIMITED, a Private Limited Company incorporated in Bangladesh under the Companies Act, 1994 having its Head Office at Alhaj Tower, Fourth Floor (Level-3), 82 Motijheel C/A, Dhaka-1000.</p><p class="s10" style="padding-left: 66pt;text-indent: 0pt;line-height: 120%;text-align: left;">Dhaka-1212 (here in after referred to as the &quot;BROKER&quot; which term shall unless excluded by or repugnant to the context be deemed to include its successors-in- office, legal representatives and assigns) of the one part;</p><p class="s10" style="padding-left: 62pt;text-indent: 0pt;text-align: center;">AND</p><p class="s19" style="padding-top: 4pt;padding-left: 86pt;text-indent: 0pt;text-align: left;">t</p><p class="s20" style="padding-top: 1pt;padding-left: 65pt;text-indent: 0pt;text-align: left;">2 <span class="s19">M: M::</span></p><p class="s10" style="padding-top: 5pt;padding-left: 76pt;text-indent: 0pt;text-align: left;">S/O/W/O.</p><p class="s10" style="padding-top: 6pt;padding-left: 76pt;text-indent: 0pt;text-align: left;">S/O/W/O.                                                   . .</p><p class="s10" style="padding-top: 6pt;padding-left: 76pt;text-indent: 0pt;text-align: left;">Of  1</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s9" style="padding-left: 66pt;text-indent: 0pt;line-height: 106%;text-align: left;">(here in after referred to as the &quot;CLIENT&quot; which term shall unless excluded by or repugnant to the context be deemed to include his/her successor(s), legal representatives and assigns) of the other part.</p><p style="padding-top: 8pt;text-indent: 0pt;text-align: left;"><br/></p><p class="s21" style="padding-left: 66pt;text-indent: 0pt;text-align: left;">WHEREAS <span class="s10">:</span></p><ol id="l1"><li data-list-text="a."><p class="s10" style="padding-top: 4pt;padding-left: 74pt;text-indent: -8pt;text-align: left;">The BROKER has been providing stock broking facilities, CDBL services and offering creait facilities to its customers;</p></li><li data-list-text="b."><p class="s9" style="padding-top: 4pt;padding-left: 75pt;text-indent: -9pt;line-height: 108%;text-align: justify;">The CLIENT has approached BROKER for credit facilities for the purchase of Securities listed with the DHAKA STOCK EXCHANGE <span class="s10">LIMITED (DSE) and CHITTAGONG STOCK EXCHANGE LIMITED (CSE) and deposit/transfer Cash/Securities in the CLIENT&#39;s name in Account No.                    and the &quot;BENEFICIARY OWNER ACCOUNT&quot; here in after</span></p><p class="s10" style="padding-left: 75pt;text-indent: 0pt;line-height: 111%;text-align: justify;">referred to as &quot;BO Account&quot; No.             with the “CENTRAL DEPOSITORY BANGLADESH LIMITED “ here in after referred to as &quot;CDBL&quot;;</p></li><li data-list-text="c."><p class="s10" style="padding-top: 3pt;padding-left: 74pt;text-indent: -8pt;line-height: 107%;text-align: justify;">The BROKER has agreed to extend credit facilities to the CLIENT for the aroresaid purpose on the terms and conditions here in after stated and both the parties wish to enter into a Margin Trading Agreement (here in after referred to as &quot;the agreement&quot;) for conducting Margin Trading in Bangladesh.</p><p style="padding-top: 7pt;text-indent: 0pt;text-align: left;"><br/></p><p class="s22" style="padding-left: 65pt;text-indent: 0pt;line-height: 11pt;text-align: left;">NOW THIS AGREEMENT WITNESSETH AS FOLLOWS</p><p class="s22" style="padding-left: 65pt;text-indent: 0pt;line-height: 11pt;text-align: left;">RULES AND PROCEDURES REGULATING MARGIN TRADING</p><ul id="l2"><li data-list-text="*"><p class="s10" style="padding-top: 3pt;padding-left: 72pt;text-indent: -4pt;text-align: left;">&quot;BROKER&quot; means ANC SECURITIES LIMITED and includes its successors and interest.</p></li><li data-list-text="*"><p class="s10" style="padding-top: 3pt;padding-left: 70pt;text-indent: -5pt;text-align: left;">&quot;CLIENT&quot; means applicant named in the application form and includes its successors and interest.</p></li><li data-list-text="*"><p class="s10" style="padding-top: 3pt;padding-left: 70pt;text-indent: -4pt;text-align: left;">&quot;SECURITIES ACCOUNT&quot; shall mean the account opened by the CLIENT with BROKER to deposit/deliver/sell/buy securities.</p></li><li data-list-text="*"><p class="s10" style="padding-top: 3pt;padding-left: 74pt;text-indent: -7pt;line-height: 111%;text-align: left;">&quot;APPROVED SECURITIES&quot; shall mean the securities approved by the BROKER to purchase into the SECURITIES ACCOUNT against Margin Loan.</p></li><li data-list-text="*"><p class="s10" style="padding-top: 2pt;padding-left: 71pt;text-indent: -5pt;text-align: left;">&quot;PORTFOLIO VALUE&quot; means total market value of all the stocks/Debentures/Bonds held in CLIENT&#39;s designated account.</p></li><li data-list-text="*"><p class="s10" style="padding-top: 3pt;padding-left: 74pt;text-indent: -9pt;line-height: 108%;text-align: left;">&quot;MARGIN CALL&quot; shall mean request to the &quot;CLIENT&quot; to deposit money or shares to bring the Debit Balance equal to or below 50% of the Portfolio Value within. 24 hours.</p></li><li data-list-text="*"><p class="s10" style="padding-top: 2pt;padding-left: 74pt;text-indent: -9pt;line-height: 108%;text-align: left;">&quot;DEBIT BALANCE&quot; shall mean the total value of cash owed by the CLIENT together with any interest, brokerage, CDBL charges and any other charges to the BROKER in the SECURITIES ACCOUNT for securities transacted into the account.</p></li></ul></li></ol><p style="text-indent: 0pt;text-align: left;"><br/></p><ol id="l3"><li data-list-text="2."><p class="s21" style="padding-left: 74pt;text-indent: -9pt;text-align: left;">THE CLIENT SHALL OPEN THE FOLLOWING TWO TYPES OF ACCOUNTS WITH BROKER.</p><ol id="l4"><li data-list-text="a."><p class="s10" style="padding-top: 4pt;padding-left: 77pt;text-indent: -12pt;text-align: left;">SECURITIES ACCOUNT</p><p class="s10" style="padding-top: 4pt;padding-left: 77pt;text-indent: 0pt;text-align: justify;">The CLIENT shall open a Securities Account with BROKER to transact shares through it in his/her/its name.</p></li><li data-list-text="b."><p class="s10" style="padding-top: 4pt;padding-left: 76pt;text-indent: -10pt;text-align: left;">BENEFICIARY OWNER (BO) ACCCUNT</p><p class="s10" style="padding-top: 4pt;padding-left: 77pt;text-indent: 0pt;text-align: left;">i) The CLIENT will open a separate BO Account through CDBL in his/her/its own name.</p><p class="s10" style="padding-top: 4pt;padding-left: 77pt;text-indent: 0pt;text-align: justify;">ii). The CLIENT shall be abide by the rules and regulations of the DSE&amp;CSE, SEC and CDBL</p><p style="padding-top: 6pt;text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 44pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="153" height="28" src="data:image/jpg;base64,"/></td></tr></table></span></p></li></ol></li><li data-list-text="3."><p class="s18" style="padding-top: 4pt;padding-left: 78pt;text-indent: -10pt;text-align: left;">Methodology</p><ol id="l5"><li data-list-text="i)"><p class="s10" style="padding-top: 4pt;padding-left: 85pt;text-indent: -18pt;text-align: left;">The CLIEN T would be required to submit an application to the Broker/Dealer for the Margin Trade Facility.</p></li><li data-list-text="ii)"><p class="s10" style="padding-top: 5pt;padding-left: 85pt;text-indent: -18pt;line-height: 108%;text-align: justify;">The CLIENT (In case of Company/Trust) shall be allowed to commence Margin Trading only when it has submitted to the BROKER copies of the relevant documents (i. e. certified copy of Trust Deed or Certificate of incorporation along with Memorandum and Articles of Association) and a resolution which authorizes that specific entity and its representatives on behalf of the client to conduct Margin Trading.</p></li><li data-list-text="iii)"><p class="s10" style="padding-top: 4pt;padding-left: 85pt;text-indent: -18pt;line-height: 106%;text-align: justify;">The facility granted under this account shall be a short term facility and shall be valid at the sole discretion of the Broker and repayable on demand of the Broker.</p></li><li data-list-text="iv)"><p class="s10" style="padding-top: 5pt;padding-left: 85pt;text-indent: -18pt;line-height: 111%;text-align: justify;">The CLIENT contribution of Share or Cash or both will be deposited to the Securities Account/BO Account. The value of shares shall be calculated on a daily basis as per day&#39;s closing price of DSE.</p></li><li data-list-text="v)"><p class="s10" style="padding-top: 4pt;padding-left: 86pt;text-indent: -18pt;line-height: 106%;text-align: justify;">The Broker will have absolute discretion to accept or decline any security against which credit facility is granted and shall reserve the right to make changes to their list of &quot;Approved Securities&quot; at any given moment.</p></li><li data-list-text="vi)"><p class="s10" style="padding-top: 5pt;padding-left: 85pt;text-indent: -18pt;line-height: 106%;text-align: justify;">0 nly &quot;Approved Securities&quot; may be used as collateral for Margin Trading. A list of the &quot;Approved Securities&quot;, to be updated from time to time, will be available with BROKER.</p></li><li data-list-text="vii)"><p class="s10" style="padding-top: 4pt;padding-left: 85pt;text-indent: -18pt;line-height: 108%;text-align: justify;">When a pre viously approved share is later disqualified for inclusion. it will be excluded from all subsequent margin calcuiations.</p></li><li data-list-text="viii)"><p class="s23" style="padding-top: 4pt;padding-left: 85pt;text-indent: -17pt;text-align: justify;">In the case of BROKER omitting a particular Securities/seeurities from the list of &quot;approved securities&quot;, the CLIENT <span class="s10">shall accordingly adjust the &quot;Portfolio value&quot; or the &quot;Debit balance&quot; within five market days. Provided that in the event of suspension of any Securities by the S EC, DSE or CSE, BROKER will be excluded from the calculation of the portfolio value at any time.</span></p></li><li data-list-text="ix)"><p class="s10" style="padding-top: 4pt;padding-left: 85pt;text-indent: -18pt;line-height: 108%;text-align: left;">The CLIEN T may, using the credit facility, purchase appoved securities through B RO KE R into the &quot;Securities Account&quot; to a maxim um value of P ortfolio approved by the regulatory bodles as The C LIEN T shall at all times be responsible to maintain strictly the maximum limit of the &quot;Debit Balance&quot; at any given time.</p></li><li data-list-text="x)"><p class="s10" style="padding-top: 4pt;padding-left: 85pt;text-indent: -17pt;text-align: justify;">If Debit ba lance goes a bove rate determined by the management due to fluctuation in the market or any other event, BROKER will issue a &quot;Marg in Call&quot; to the CLIE NT. Margin Call may be either in writing or via telephone call.</p></li><li data-list-text="xi)"><p class="s10" style="padding-top: 4pt;padding-left: 85pt;text-indent: -17pt;line-height: 108%;text-align: justify;">If the CLIENT doesn&#39;t respond to Margin Call, BROKER will than sell out whatever shares as it appears fit to regularize the &quot;Debit balance&quot; reaches to maximum Limit to (+/- 5% deviation is accepted in case of adjustment) and the broker/dealer may act upon as the Attorney of the CLIENT in accordance with the terms thereof and in terms of the margin rules.</p></li><li data-list-text="xii)"><p class="s10" style="padding-top: 4pt;padding-left: 84pt;text-indent: -17pt;line-height: 108%;text-align: justify;">If the &quot;Debit balance&quot; reaches to rate determined by management from time to time due to a sudden fall in the market or for any other event, BROKER will sell out shares of any company whatsoever as it thinks fit to make the Debit Balance determined by management without any margin call or notice whatsoever. Any redidual shares will remain in the account and will be available to CLIENT.</p></li><li data-list-text="xiii)"><p class="s10" style="padding-top: 4pt;padding-left: 84pt;text-indent: -17pt;line-height: 108%;text-align: left;">If the CLIENT exceeds the value of the &quot;Debit Balance&quot; above the stipulated limit and/or violates any other terms and conditions mules/requirements as laid down by the BROKER or any regulatory authority from time to time, the BROKER shall have absolute discretion at the <b>&quot;CLIENT </b>risk to sell/buy any or all shares or securities of any Company whatsoever in the CLIENT &quot;Securities Account&quot; without any consent of any form from the CLIENT in order to adjust the Debit Balance of the &quot; Securities Account&quot;. In the event the Portfolio value of the &quot;Securities Account&quot; becomes inadequate to regularize the &quot;Debit Balance&quot;, the CLIENT shall be under obligation to make cash payment to settle any shortfall.</p></li><li data-list-text="xiv)"><p class="s10" style="padding-top: 4pt;padding-left: 84pt;text-indent: -17pt;text-align: justify;">The CLIENT shall pay brokerage commission for all transactions i.e. buy and sell in the &quot;Securities Account&quot;. The CLIENT shall also pay brokerage commission for all transcations careied our in order to regularize the &quot;Securities Account&quot;. Rate of brokerage will be fixed by the BROKER and can be changed from time to time.</p></li></ol><p class="s10" style="padding-top: 5pt;padding-left: 85pt;text-indent: -17pt;line-height: 109%;text-align: justify;">XV) Broker shall have the authority to give notice to the CLIENT to adjust the debit balance in Securities Account within 20 (Twenty) trading days for whatever reason with the right to divulge the reasons to the GLIENT. If the CLIENT doesn&#39;t respond to such notice BROKER shall than have absolute discretion at the CLIENT risk to sell/buy any or all shares or securities of any Company whatsoever in the CLIENT &quot;Securities Account&quot; without any consent of any form from the CLIENT in order to adjust the Debit Balance of the Securities Account.</p><ol id="l6"><li data-list-text="xvi)"><p class="s10" style="padding-top: 4pt;padding-left: 85pt;text-indent: -17pt;line-height: 106%;text-align: justify;">Broker will charge CLIENT account for any debit amount, calculated on a daily basis to be accounted for at the end of the calendar month. Broker shall advice the interest rate to the CLIENT from time to time. Broker reserves the right to increase/decrease the interest rate by giving 7 (Seven) trading days notice to the CLIENT.</p></li><li data-list-text="xvii)"><p class="s10" style="padding-top: 4pt;padding-left: 86pt;text-indent: -18pt;line-height: 106%;text-align: justify;">The Securities Account will be fully operated (All Buy/Sell decisions) by the CLIENT at all times other than in the instance of Brokerage regularizing the account as are explained in xi, xii, xiii, xiv ,xv of clause 3 hereof.</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 413pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="153" height="28" src="data:image/jpg;base64,"/></td></tr></table></span></p><p style="padding-top: 4pt;text-indent: 0pt;text-align: left;"><br/></p></li><li data-list-text="xviii)"><p style="padding-left: 84pt;text-indent: -17pt;text-align: left;">Trading will take place in the same way as the normal accounts i.e. either by giving written order, by facsimile message or e-mail.</p></li><li data-list-text="xix)"><p style="padding-top: 4pt;padding-left: 84pt;text-indent: -17pt;text-align: left;">Interest on the Margin Trading Facility is repayable on or before the end of every calendar month by way of depositing cash or adjustment in the Securities Account.</p></li><li data-list-text="xx)"><p style="padding-top: 4pt;padding-left: 84pt;text-indent: -17pt;text-align: left;">Broker shall have the right to change, rectify, include any terms and condtions in addition to the above at any time with 7 (Seven) trading days notice to the CLIENT.</p></li></ol><p style="padding-top: 9pt;text-indent: 0pt;text-align: left;"><br/></p></li><li data-list-text="4."><p style="padding-left: 76pt;text-indent: -10pt;text-align: justify;">Securities</p><p style="padding-top: 4pt;padding-left: 66pt;text-indent: 0pt;text-align: justify;">The shares or cash brought by the CLIENT together with shares purchased by using debit balance will be considered as collateral for the Margin Trading facility. Broker may assign such collateral with any financial institution including bank. However, the shares brought by the CLIENT to cover Margin Requirement should meet following criteria:</p><p style="text-indent: 0pt;text-align: left;"><br/></p><ol id="l7"><li data-list-text="a)"><p style="padding-left: 75pt;text-indent: -9pt;text-align: left;">The shares should be acceptable to the Broker</p></li><li data-list-text="b)"><p style="padding-top: 4pt;padding-left: 75pt;text-indent: -9pt;text-align: left;">The shares should be tradable in the DSE&amp;CSE.</p></li><li data-list-text="c)"><p style="padding-top: 4pt;padding-left: 75pt;text-indent: -9pt;text-align: left;">The shares should possess reasonable liquidity.</p></li></ol><p style="padding-top: 5pt;padding-left: 66pt;text-indent: 0pt;line-height: 107%;text-align: left;">Broker may also take additional securities as collateral from the CLIENT depending on the tradable demand of the shares offered by the CLIENT.</p><p style="padding-top: 4pt;text-indent: 0pt;text-align: left;"><br/></p></li><li data-list-text="5."><h4 style="padding-left: 76pt;text-indent: -10pt;text-align: justify;">The CLIENT hereby irrevocably authorizes the Broker:</h4><ol id="l8"><li data-list-text="a."><p style="padding-top: 4pt;padding-left: 79pt;text-indent: -13pt;text-align: justify;">to deal with all the CLIENT&#39;s securities deposited in the B.O. account with &quot;Central Depositary System&quot;(CDS) &amp; Securities Account from time to time independently at its sole discretion as long as the CLIENT&#39;s liabilities in the repayment of all such facilities remain outstanding.</p></li><li data-list-text="b."><p style="padding-top: 3pt;padding-left: 80pt;text-indent: -14pt;text-align: justify;">to purchase and sell any such securities of the CLIENT deposited with &quot;CDS&quot; and to deal or negotiate with other institution, engaged in the purchase or sale of any securities on the CLIENT&#39;s behalf and to deal with any other matters relating to the &quot;Securities/BO Account&quot; with or without CLIENT&#39;s instructions and the CLIENT hereby agrees that he/it shall at all times ratify and endorse such acts of the Broker. The BROKER shall not be liable for any loss caused to the CLIENT directly or indirectly resulting from any such act of commission or omission.</p></li><li data-list-text="c."><p style="padding-top: 4pt;padding-left: 80pt;text-indent: -13pt;text-align: justify;">	to debit the &quot;Securities Account&quot; for any sums or sum of money being purchased priec of margin able securities, brokers&#39; commissions, payments for rights and benefits in respect of marginal securities, transaction fee, interest, CDBL charges or for any payment whatsoever.</p></li><li data-list-text="d."><p style="padding-top: 4pt;padding-left: 80pt;text-indent: -13pt;text-align: justify;">	to issue pay-orders, Bank drafts or transfer of funds by any means to any person or persons and for many amount in respect of any transaction pertaining to the business averred herein.</p></li><li data-list-text="e."><p style="padding-top: 4pt;padding-left: 80pt;text-indent: -13pt;text-align: justify;">to deposit cash, cheque or any other instruments into the &quot;Securities Account&quot;</p></li><li data-list-text="f."><p style="padding-top: 5pt;padding-left: 80pt;text-indent: -13pt;text-align: justify;">to debit the CLIENT Securities account for interest, brokerage, CDBL Shares, and other service charges, if any.</p><p style="padding-top: 5pt;text-indent: 0pt;text-align: left;"><br/></p></li></ol></li><li data-list-text="6."><p style="padding-left: 77pt;text-indent: -10pt;text-align: left;">Indemnity</p><p style="padding-top: 4pt;padding-left: 79pt;text-indent: -12pt;text-align: left;">a) The CLIENT shall indemnify the BROKER in full and keep indemnified, save and harmless against any losses, suits, claims and damages that the BROKER shall or may be caused, sustained, incurred or suffered by any reason in maintaining the CLIENT&#39;s accounts and using the Margin Trading Facilities in any manner whatsoever and/or acting on the instructions or requests, advices made or forwarded by way or telephone or Facsimile and electronic messages.</p><p style="padding-top: 4pt;text-indent: 0pt;text-align: left;"><br/></p></li><li data-list-text="7."><p style="padding-left: 77pt;text-indent: -10pt;text-align: justify;">Power of Attorney</p><p style="padding-top: 4pt;padding-left: 67pt;text-indent: 0pt;text-align: left;">The CLIENT hereby gives irrevocable power of attorney to BROKER to operate its/his/her B.O. account and Securiries Account to exercise any of the powers as stated in xi, xii, xiii, xiv, xv of clause 3 hereof.</p><p style="padding-top: 5pt;text-indent: 0pt;text-align: left;"><br/></p></li><li data-list-text="8."><h4 style="padding-left: 77pt;text-indent: -10pt;text-align: justify;">The BROKER agrees with the CLIENT as follows:</h4></li></ol><ol id="l9"><li data-list-text="a)"><p style="padding-top: 4pt;padding-left: 81pt;text-indent: -13pt;text-align: justify;">BROKER shall act directly as the agent of the CLIENT in respect of all dealings of margin Approved Securities and the CLIENT shall remain principally liable for all dealings, negotiations and transactions entered into by the BROKER on behalf of the CLIENT</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 44pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="153" height="28" src="data:image/jpg;base64,"/></td></tr></table></span></p><p style="text-indent: 0pt;text-align: left;"><br/></p></li><li data-list-text="b)"><p style="padding-left: 80pt;text-indent: -13pt;text-align: justify;">Both the BROKER and CLIENT shall have the right at any time in their absolute discretion and without having reason therefore to close the &quot;Securities Account&quot; by giving one month prior notice of closure to the CLIENT and any debit of the CLIENT &quot;Securities Account (if any) will be adjusted.</p></li><li data-list-text="c)"><p style="padding-top: 4pt;padding-left: 80pt;text-indent: -13pt;text-align: justify;">	This agreement shall be binding on the parties, their successors, heirs, executors, administrators, assigns, or legal representatives.</p></li><li data-list-text="d)"><p style="padding-top: 4pt;padding-left: 80pt;text-indent: -13pt;text-align: justify;">The terms and conditions shall not be altered, amended or modified except in writing by the duly authorized representatives of each party hereto.</p></li><li data-list-text="e)"><p style="padding-top: 5pt;padding-left: 80pt;text-indent: -13pt;line-height: 93%;text-align: justify;">Where the CLIENT is in default of payment of legal fees, stamp duty or other out of pocket expenses incurred by the BROKER, the BROKER shall have the right and discretion to recover such expenses from the CLIENT by debiting the Securities Account.</p></li></ol><p style="padding-top: 9pt;text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 67pt;text-indent: 0pt;text-align: justify;">9) Client Statement -at each month and the broker will provide the client with a printed statement of their Securities Account detailing the number of shares held and the debit balance if any.</p><p style="padding-top: 9pt;text-indent: 0pt;text-align: left;"><br/></p><h4 style="padding-left: 67pt;text-indent: 0pt;text-align: justify;">10. Nominee</h4><p style="padding-top: 4pt;padding-left: 67pt;text-indent: 0pt;text-align: justify;">In the event of the death of one of the joint account holders, the survivor and on the death of sole account holder the nominee or successor shall be the beneficiary of the 