y and CDBL Participant pertaining to an account which are in force now have been read by me/us and I/we have understood the same and I/we agree to abide by and to be bound by the rules as are in force from time to time for such accounts. I/we also declare that the particulars given by me/us are true to the best of my/our knowledge as on the date of making such application. IMe further agree that any false/ misleading information given by me/us or suppression of any material fact will render my/our account liable for termination and further action.</p><p style="padding-left: 61pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="603" height="58" src="data:image/jpg;base64,"/></td></tr></table></span></p><p style="padding-top: 5pt;text-indent: 0pt;text-align: left;"><br/></p><p class="s13" style="padding-top: 2pt;padding-left: 6pt;text-indent: 0pt;text-align: left;">First Applicant</p><p class="s12" style="padding-top: 4pt;padding-left: 6pt;text-indent: 0pt;text-align: left;">Joint Applicant</p><p class="s12" style="padding-top: 3pt;padding-left: 6pt;text-indent: 0pt;text-align: left;">Third Signatory (Ltd. Company only)</p><p style="padding-left: 61pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="603" height="53" src="data:image/jpg;base64,"/></td></tr></table></span></p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s13" style="padding-left: 81pt;text-indent: 0pt;line-height: 182%;text-align: left;">Either or Survivor                Anyone Can Operate               Any Mo will operate jointly Account will be operated by                        with anyone of the others.</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p class="s13" style="padding-left: 66pt;text-indent: 0pt;text-align: left;">Introduction by an existing account holder of ANC <b>Securities Ltd.</b></p><p class="s13" style="padding-top: 4pt;padding-