set out below. in consideration of ANC Securities Ltd. (the &quot;CDBL Participant&quot;) opening the account providing depository account facilities to me/us,I/we have signed the BO Account Opening Form as a token of acceptance of the terms and conditions set out bellow.</p><ol id="l10"><li data-list-text="1."><p class="s10" style="padding-top: 4pt;padding-left: 83pt;text-indent: -14pt;line-height: 108%;text-align: left;">I/we agree to be bound by The Depositories Act, 1999, Depositories Regulations, 2000, The Depository (User Regulations 2003, and abide by the Bye Laws and Operating Instructions issued from time to time by CDBL</p></li><li data-list-text="2."><p class="s10" style="padding-top: 5pt;padding-left: 83pt;text-indent: -14pt;line-height: 107%;text-align: justify;">CDBL shall allocate a unique identification number to me/us (Account Holder BO ID) for the CDBL Participant to maintain a separate Account for me/us, unless I/we instruct the CDBL Participant to keep the Securities in an Omnibus Account of the CDBL Participant. The CDBL Participant shall however ensure that my/our securities shall not be mixed with the CDBL Participant&#39;s own securities.</p></li><li data-list-text="3."><p class="s10" style="padding-top: 5pt;padding-left: 83pt;text-indent: -14pt;line-height: 107%;text-align: left;">I/we agree to pay such fees, charges and deposits to the CDBL Participant, as may be mutually agreed upon, for the purpose of opening and maintaining my/our account, for carrying out the instructions and for rendering such other services as are incidental or consequential to my/our holding securities in and transacting through the said depository account with the CDBL Participant.</p></li><li data-list-text="4."><p class="s10" style="padding-top: 5pt;padding-left: 83pt;text-indent: -13pt;text-align: left;">I/we shall responsible for:</p><ol id="l11"><li data-list-text="a)"><p class="s10" style="padding-top: 4pt;padding-left: 98pt;text-indent: -15pt;text-align: left;">The veracity of all statements and perticulars set out in the account opening form, supporting or accompanying documents;</p></li><li data-list-text="b)"><p class="s10" style="padding-top: 4pt;padding-left: 97pt;text-indent: -13pt;line-height: 108%;text-align: left;">	The authenticity and genuine ness of all certificates and/or documents submitted to the CDBL Participant along with or in support of the account opening form subsequently for dematerialization;</p></li><li data-list-text="c)"><p class="s10" style="padding-top: 4pt;padding-left: 97pt;text-indent: -14pt;text-align: left;">Title to the securities submitted to the CDBL Participant from time to time for dematerialization;</p></li><li data-list-text="d)"><p class="s10" style="padding-top: 4pt;padding-left: 97pt;text-indent: -13pt;line-height: 108%;text-align: left;">	Ensuring at all times that the securities to the credit of my/our account are sufficient to meet the instructions issued to the CDBL Participant for affecting any transaction/transfer;</p></li><li data-list-text="e)"><p class="s10" style="padding-top: 3pt;padding-left: 96pt;text-indent: -13pt;line-height: 111%;text-align: left;">	Informing the CDBL Participant at the earliest of any changes in my/our account particulars such as address, bank details, status authorizations, mandates, nomination, signature, etc.;</p><p class="s31" style="padding-top: 3pt;padding-left: 83pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="6" height="10" src="data:image/jpg;base64,"/></td></tr></table></span> <span class="s10">Furnishing accurate identification details whilst subscribing to any issue of securities.</span></p></li></ol></li><li data-list-text="5."><p class="s10" style="padding-top: 4pt;padding-left: 96pt;text-indent: -14pt;line-height: 107%;text-align: justify;">	I/we shall notify the CDBL Participant of any change in the particulars set our in the application from submitted to the CDBL Participant at the time of opening the account or furnishing to the CDBL Participant from time to time at the earliest. The CDBL Participant shall not be liable or responsible for any loss that may be caused to me/us by reason of my/our failure to intimate such change to the CDBL Participant at the earliest.</p></li><li data-list-text="6."><p class="s10" style="padding-top: 4pt;padding-left: 97pt;text-indent: -14pt;text-align: justify;">Where I/we have executed a BO Account Nomination Form:</p><ol id="l12"><li data-list-text="a)"><p class="s10" style="padding-top: 4pt;padding-left: 97pt;text-indent: -14pt;text-align: justify;">In the event of my/our death, the nominees shall receive/draw the securities held in my/our account.</p></li><li data-list-text="b)"><p class="s10" style="padding-top: 4pt;padding-left: 96pt;text-indent: -13pt;line-height: 106%;text-align: justify;">	In the event, the nominee so authorized remains a minor at the time of my/our death, the legal guardian is authorized to receive/draw the securities held in my/our account.</p></li><li data-list-text="c)"><p class="s10" style="padding-top: 4pt;padding-left: 96pt;text-indent: -14pt;line-height: 106%;text-align: justify;">	The nominee so authorized, shall be entitled to all my/our account to the exclusion of all other persons i.e., my/our heirs, executors and administrators and all other persons claiming through or under me/us and delivery of securities to the nominee pursuance of this authority shall be binding on all other persons.</p></li></ol></li><li data-list-text="7."><p class="s10" style="padding-top: 6pt;padding-left: 83pt;text-indent: -13pt;line-height: 107%;text-align: justify;">	I/we at any time call upon the CDBL Participant to close my/our account with the CDBL Participant provided no instructions remain pending or unexecuted and on fees or charges remain payable by me/us to the CDBL Participant. In such event I/we may close my/our account by executing the Account Closing Form if no balances are standing to my/our credit in the account. In case any balances of securities exist in the account may be closed by me/us in one of the following ways:</p><p style="text-indent: 0pt;text-align: left;"><br/></p><p style="padding-left: 44pt;text-indent: 0pt;text-align: left;"><span><table border="0" cellspacing="0" cellpadding="0"><tr><td><img width="153" height="28" src="data:image/jpg;base64,"/></td></tr></table></span></p><p style="text-indent: 0pt;text-align: left;"><br/></p><ol id="l13"><li data-list-text="a)"><p style="padding-left: 96pt;text-indent: -15pt;text-align: left;">By remateriaization of all existing balances in my/our account;</p></li><li data-list-text="b)"><p style="padding-top: 3pt;padding-left: 94pt;text-indent: -14pt;text-align: left;">	By transfering of all existing balances in my/our account to one or more of my/our account(s) held with any other CDBL Participant(s);</p></li><li data-list-text="c)"><p style="padding-top: 3pt;padding-left: 94pt;text-indent: -14pt;text-align: left;">	By rematerialization of a part of the existing balances in my/our account and by transfarring the rest to one or more of my/our other account(s) with any other CDBL participants(s);</p></li></ol></li><li data-list-text="8."><p style="padding-top: 5pt;padding-left: 81pt;text-indent: -15pt;text-align: left;">CDBL Participant covenants that it shall;</p><ol id="l14"><li data-list-text="a)"><p style="padding-top: 3pt;padding-left: 94pt;text-indent: -13pt;text-align: left;">	Act only on the instructions or mandate of the Account Holder or that of such person(s) as may have been duly authorized by the Account Holder in that behalf;</p></li><li data-list-text="b)"><p style="padding-top: 3pt;padding-left: 95pt;text-indent: -15pt;text-align: left;">Not affect any debit or credit to and from the account of the Account Holder without appropriate instructions from the Account Holder;</p><ol id="l15"><li data-list-text="C)"><p style="padding-top: 3pt;padding-left: 95pt;text-indent: -15pt;text-align: left;">Maintain adequate audit trail of the execution of the instructions of the Account Holder;</p></li><li data-list-text="D)"><p style="padding-top: 4pt;padding-left: 95pt;text-indent: -15pt;text-align: left;">Not honor or act upon any instructions for effecting any debit to the account of the Account Holder in respect of any securities unless;</p><ol id="l16"><li data-list-text="i)"><p style="padding-top: 3pt;padding-left: 97pt;text-indent: -17pt;text-align: left;">Such instructions are issued by the Account Holder under his signature or that of his/its constituted attorney duly authorized in that behalf;</p></li><li data-list-text="ii)"><p style="padding-top: 3pt;padding-left: 94pt;text-indent: -14pt;text-align: left;">	The CDBL Participant is satisfied that the signature of the Account Holder under which instructions are issued matches with the specimen of the Account Holder or his / its constituted attorney available on the records of the CDBL Participant;</p></li><li data-list-text="iii)"><p style="padding-top: 4pt;padding-left: 97pt;text-indent: -17pt;text-align: left;">The balance of clear securities available in the Account Holder&#39;s account is sufficient to honot the Account Holder&#39;s instructions.</p></li></ol></li></ol><ol id="l17"><li data-list-text="e)"><p style="padding-top: 3pt;padding-left: 93pt;text-indent: -13pt;text-align: justify;">	Furnish to the Account Holder a statement of account at the end of every month if there has been even a single entry or transaction during that month, and in any event once at the end of each financial year. The CDBL Participant shall furnish such statements at such shorter periods as may be required by the Account Holder on payment of such charges by the Account Holder as may be specified by the CDBL Participant. The Account Holder shall scrutinize every statement of account received from the CDBL Participant for the accuracy and veracity thereof and shall promptly bring to the notice of the CDBL Participant any mistakes, inaccuracies or discrepancies in such statements</p></li><li data-list-text="f)"><p style="padding-top: 3pt;padding-left: 94pt;text-indent: -13pt;text-align: justify;">	Promptly attend to all grievances / complaints of the Account Holder and shall resolve all such grievances / complaints as it relate to matters exclusively within the domain of the CDBL Participant within one month of the same being brought to the notice of the CDBL Participant and shall forthwith fonyard to and follow up with CDBL all other grievances/complaints of the Account Holder on the same being brought to the notice of the CDBL Participant and shall endeavor to resolve the same at the earliest.</p></li></ol></li></ol></li><li data-list-text="9."><p style="padding-top: 5pt;padding-left: 80pt;text-indent: -13pt;text-align: justify;">The CDBL Participant shall be entitled to terminate the account relationship in the event of the Account Holder:</p><ol id="l18"><li data-list-text="a)"><p style="padding-top: 3pt;padding-left: 94pt;text-indent: -13pt;text-align: justify;">	Failing to pay the fees or charges as may be mutually agreed upon within a period of one month from the date of demand made in that behalf;</p></li><li data-list-text="b)"><p style="padding-top: 3pt;padding-left: 95pt;text-indent: -14pt;text-align: justify;">	Submitting for dematerialization any certificates or other documents of title which are forged, fabricated, counterfeit or stolen or have been obtained by forgery or the transfer whereof is restrained or prohibited by any direction, order or decree of any court or the Securities and Exchange Commission;</p></li><li data-list-text="c)"><p style="padding-top: 3pt;padding-left: 96pt;text-indent: -15pt;text-align: justify;">Commits or participates in any fraud or other act of moral turpitude in his / its dealings with the CDBL Participant;</p></li><li data-list-text="d)"><p style="padding-top: 4pt;padding-left: 95pt;text-indent: -1